import "./Nav.css";

function Nav() {
  return ( <div class="nav">
  <div class="nav__contents">
      <img 
    className="nav__logo"
    src="https://i.ytimg.com/vi/GV3HUDMQ-F8/maxresdefault.jpg" alt="" />

    <img
    className="nav__avatar"
     src="https://i.pinimg.com/474x/44/78/1b/44781ba4ac0c63f2ecf0793a533bf8dc.jpg" alt="" />
  </div>
  </div>
  )
};

export default Nav
